import React from 'react';

const Footer = (props) =>{
	return(
		<footer>
			<p>Octopus Energy Ltd is a company registered in England and Wales.</p>
			<p>Registered number: 09263424. Registered Office: 33 Holborn, London, EC1N 2HT. Trading office: 20-24 Broadwick Street, London, W1F 8HT</p>
		</footer>
	)
};
export default Footer;
